import React, { useEffect, useState } from 'react';
import { load } from '@huggingface/tfjs';

function NERComponent() {
  const [model, setModel] = useState(null);
  const [text, setText] = useState('');
  const [entities, setEntities] = useState([]);

  useEffect(() => {
    const loadModel = async () => {
      const model = await load('dbmdz/bert-large-cased-finetuned-conll03-english');
      setModel(model);
    };

    loadModel();
  }, []);

  const handlePredict = async () => {
    if (model) {
      const prediction = await model.predict(text);
      setEntities(prediction);
    }
  };

  return (
    <div>
      <input value={text} onChange={e => setText(e.target.value)} />
      <button onClick={handlePredict}>Predict</button>
      <ul>
        {entities.map((entity, index) => (
          <li key={index}>{entity}</li>
        ))}
      </ul>
    </div>
  );
}

export default NERComponent;
